import football from './images/icons/football.webp'
import voleyball from './images/icons/voleyball2.png'
import teacher from './images/icons/teacher.png'
import hat from './images/icons/hat.png'

export default function WhoUs() {

    function give_img(el) {
        return(<img key={el.alt} className='w-48 mx-10' src={el.src} alt={el.alt} />)
    }

    const attr = [{src:football, alt:"football icon"},{src:voleyball, alt:"voleyball icon"},{src:teacher, alt:"teacher icon"},{src:hat, alt:"hat icon"}]

    return(<>
    <div className="flex justify-center 
    lg:w-full">
        {attr.map(el => give_img(el))}

    </div>
    </>)}
